import React from 'react';

const ModelDetails = ({ config, onClose }) => {
  if (!config) return null;

  return (
    <div className="modal">
        <div className="modal-content">
            <h2>Details</h2>
            <p>{config.name}</p>
            <p>{config.description}</p>
            <p>{config.model_file}</p>
            <p>{config.created_date}</p>
            <p>{config.table_configuration_id}</p>
            <button onClick={onClose}>Close</button>
        </div>
    </div>
  );
};

export default ModelDetails;
